  return (
    <div className='special'>
      <div className='qqwwee'>
        <h1>Specials</h1>
        <div className='ss'>
          {

            pictures.map((item, index) => (
              <Item key={index} image={item.image} text={item.text} />
            ))
          }
        </div>
      </div>

    </div>
  );
}

export default Special;
